    output = []
    for op in operators:
        if op == "+":
            b = stack.pop()
            a = stack.pop()
            stack.append(a + b)
        elif op == "-":
            b = stack.pop()
            a = stack.pop()
            stack.append(a - b)
        else:
            stack.append(op)

    # Add the remaining operands to the output
    for op in stack:
        if op.isdigit():
            output.append(op)

    # Convert the output list to a string and return it
    return "".join(output)

