        if not s:
            return None

        head = ListNode(int(s[0]))
        current = head
        for i in range(1, len(s)):
            current.next = ListNode(int(s[i]))
            current = current.next

        return head

    def list_to_string(head: ListNode) -> str:
        if not head:
            return ""

        result = str(head.val)
        current = head.next

        while current:
            result += " " + str(current.val)
            current = current.next

        return result

