                return False
        return True

    def lexicographically_smallest_word(grid: List[List[str]]) -> str:
        def backtrack(i: int, j: int, word: str, words: List[str]) -> None:
            if i == len(grid) - 1:
                if is_valid(word):
                    words.append(word)
                return
            for k in range(j, len(grid[i])):
                if grid[i][k] == '#' or (i > 0 and grid[i - 1][k] == '#'):
                    continue
                backtrack(i + 1, k + 1, word + grid[i][k], words)

        words = []
        backtrack(0, 0, '', words)
        return min(words, key=len)

    return lexicographically_smallest_word(grid)

