    crossword = []

    for i in range(M):
        row = []
        for j in range(N):
            row.append(stdin.split()[i + 2][j])
        crossword.append("".join(row))

    framed_crossword = []
    for i in range(M + U + D):
        row = []
        for j in range(N + L + R):
            if i < U:
                row.append(frame[i])
            elif i < U + L:
                row.append(crossword[i - U][j])
            elif i < U + L + R:
                row.append(frame[i - U - L])
            else:
                row.append(frame[i - U - L - R])
        framed_crossword.append("".join(row))

    return "\n".join(framed_crossword)

