    map_ = [list(row) for row in stdin.split()[1:]]
    player_pos = (0, 0)
    gold_count = 0
    traps = []

    def is_safe(x, y):
        return 0 <= x < W and 0 <= y < H and map_[x][y]!= '#'

    def move(dx, dy):
        nonlocal player_pos, gold_count, traps
        x, y = player_pos
        if is_safe(x + dx, y + dy):
            player_pos = (x + dx, y + dy)
            if map_[x + dx][y + dy] == 'G':
                gold_count += 1
            elif map_[x + dx][y + dy] == 'T':
                traps.append((x + dx, y + dy))
        else:
            player_pos = (x, y)

    def sense_draft():
        nonlocal player_pos, gold_count, traps
        x, y = player_pos
        for dx, dy in [(0, 1), (1, 0), (0, -1), (-1, 0)]:
            if is_safe(x + dx, y + dy):
                if map_[x + dx][y + dy] == 'T':
                    return (x + dx, y + dy)
        return None

    while True:
        move(0, 1)
        if sense_draft() is not None:
            move(*sense_draft())
        else:
            break

    return str(gold_count)

