def solution(stdin: str) -> str:
    # Convert the input string to lowercase and remove spaces
    input_string = stdin.lower().replace(" ", "")

    # Initialize a dictionary to store the frequency of each letter in the input string
    letter_frequency = {}

    # Iterate through the input string and update the frequency of each letter
    for letter in input_string:
        if letter in letter_frequency:
            letter_frequency[letter] += 1
        else:
            letter_frequency[letter] = 1

    # Initialize a list to store the letters of the input string in the order they appear
    input_string_letters = list(input_string)

    # Sort the letters of the input string in alphabetical order
    input_string_letters.sort()

    # Initialize a variable to store the minimum number of characters that have to be removed
    min_chars_to_remove = 0

    # Iterate through the sorted letters of the input string
    for i in range(len(input_string_letters)):
        # If the current letter is already a palindrome, skip it
        if input_string_letters[i] == input_string_letters[::-1]:
            continue

        # If the current letter is not a palindrome, check if it can be removed from the input string
        for j in range(i + 1, len(input_string_letters)):
            # If the current letter and the next letter form a palindrome, remove the current letter
            if input_string_letters[i] + input_string_letters[j] == input_string_letters[::-1]:
                min_chars_to_remove += 1
                break

        # If the current letter and the next letter do not form a palindrome, break out of the inner loop
        if min_chars_to_remove > 0:
            break

    return str(min_chars_to_remove)

