    def dfs(i, j, visited):
        if (i, j) in visited:
            return 0
        visited.add((i, j))

        if grid[i][j] == 'L':
            return 1

        up = dfs(i - 1, j, visited)
        down = dfs(i + 1, j, visited)
        left = dfs(i, j - 1, visited)
        right = dfs(i, j + 1, visited)

        return min(up, down, left, right)

    islands = 0
    visited = set()
    for i in range(rows):
        for j in range(cols):
            if grid[i][j] == 'L':
                islands += dfs(i, j, visited)

    return str(islands)

