    D = list(map(int, stdin.split()[1:]))

    def gcd(a, b):
        while b:
            a, b = b, a % b
        return a

    def lcm(a, b):
        return a * b // gcd(a, b)

    def color_difference(a, b):
        return abs(a - b)

    def count_machines(D, C, K):
        machines = []
        for i in range(len(D)):
            for j in range(i + 1, len(D)):
                if color_difference(D[i], D[j]) <= K:
                    machines.append((i, j))
                    break
        return len(machines)

    def wash_machine(D, C, K):
        machines = count_machines(D, C, K)
        if machines == 0:
            return 0
        else:
            return lcm(C, machines)

    return str(wash_machine(D, C, K))

