    for i in range(n):
        students_per_room[i] = s[i]

    visited_rooms = set()
    visited_rooms.add(0)
    rooms_to_visit = [0] * n
    rooms_to_visit[0] = 1

    while rooms_to_visit:
        room = rooms_to_visit.pop(0)
        if room not in visited_rooms:
            visited_rooms.add(room)
            students_in_room = students_per_room[room]
            if students_in_room > 0:
                students_per_room[room] = 0
                for i in range(n):
